import Link from "next/link";
import useSWR from 'swr';
import {DatePicker,MuiPickersUtilsProvider } from '@material-ui/pickers';
import {createMuiTheme, makeStyles, ThemeProvider} from '@material-ui/core/styles';
import DateFnsUtils from '@date-io/date-fns';
import React, {useEffect, useState} from "react";
import {orange} from "@material-ui/core/colors";
import {useRouter} from "next/router";
import {Typography} from "@material-ui/core";
import withAuth from "../components/WithAuth";

const useStyle = makeStyles(theme=>({
    center:{
        display:'flex'
    }
}));

function Index(props) {
    const classes = useStyle();

 return(
     <div className={classes.center}>
         {props.session!==null?<Typography className={classes.header} variant="h4">{props.session }</Typography>:null}
         <svg xmlns="http://www.w3.org/2000/svg" width={"100"} viewBox="0 0 33.29 246.88">
             <defs>
                 <style>{".cls-1,.cls-3{fill:none;stroke-miterlimit:10;}.cls-1{stroke:"+props.theme===1?"black":"white"+";stroke-width:0.25px;}.cls-2{fill:#4950f5;}.cls-3{stroke:#4950f5;stroke-linecap:round;stroke-width:7px;}"}</style>
             </defs>
             <title>Datov√Ω zdroj 2</title>
             <g id="Vrstva_2" data-name="Vrstva 2">
                 <g id="Vrstva_2-2" data-name="Vrstva 2">
                     <path className="cls-1" d="M23.88,215.39a16.51,16.51,0,1,1-14.46,0"/>
                     <circle className="cls-2" cx="16.65" cy="230.23" r="12.65"/>
                     <path className="cls-1"
                           d="M23.88,215.39V7.35A7.23,7.23,0,0,0,16.65.13h0A7.23,7.23,0,0,0,9.42,7.35v208"/>
                     <line className="cls-3" x1="16.65" y1="230.23" x2="16.64" y2="58.96"/>
                 </g>
             </g>
         </svg>
     </div>
 )
}

export default withAuth(Index);
